import React from 'react'
import styled from 'styled-components'

export default function Footer() {
  return (
    <FooterContainer>
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
        <h1>Footer</h1> 
    </FooterContainer>
  )
}

const FooterContainer=styled.div`
border: 2px solid pink;
position: relative;
top: 32%;
`
